import React, { useContext, useEffect, useState } from "react";
import { Link, NavLink, useNavigate } from "react-router-dom";
import pic from "../images/homepage.jpg";
import Footer from "../components/Footer.js";
import "./AboutUs.css";
import "./InvisiScroll.css";
import "./mediaqueries.css";
import Card from "../components/Card";
import image1 from "../images/developer1.jpg";
import image2 from "../images/developer2.jpg";
import image3 from "../images/developer3.jpg";
function AboutUs() {
  useEffect(() => {
    return () => {};
  }, []);

  const navigate = useNavigate();

  const handleGoBack = () => {
    navigate(-1); // Go back one step in the browser history
  };

  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const linkStyle = {
    position: "fixed",
    top: "2vh",
    right: "11vh",
    cursor: "pointer",
    fontSize: "4.5vh",
    fontWeight: "bolder",
    backgroundColor: "#ffe600",
    border: "0.4vh solid #fff380",
    borderRadius: "1vh",
    color: "#000000",
  };

  return (
    <div className="card-container">
      <Footer />
      isLoggedIn && (
      <Link to="/dashboard" className="link">
        <button className="linkButton" style={linkStyle}>
          Return to Dashboard
        </button>
      </Link>
      )
      <div style={{ margin: "5vh" }}>
        <div>
          <section>
            <h2 style={{ fontWeight: "bolder", fontSize: "10vh", margin: 0 }}>
              Welcome to InBang!!
            </h2>
            <p style={{ textDecoration: "underline" }}>
              We create wonderful experiences for people to have choices,
              overcome challenges, and discover new ways to enjoy life.
            </p>
            <br />
            <br />
            <br />
          </section>
          <section>
            <h2>Latest News</h2>
            <div>
              <img
                style={{ width: "100vw" }}
                src="data:image/jpeg;base64,"
                alt="Watching the InBang on the coutch"
              />
              <p>
                Calling all Reveluvs out there! Following its successful
                collaboration with SM Entertainment on EXO, NCT, and SMTOWN,
                0917 Lifestyle is back at it again. Get ready as the 0917 x Red
                Velvet...
              </p>
              <br />
              <br />
              <br />
              <div></div>
              <h2
                style={{
                  textAlign: "center",
                  fontSize: "5vh",
                  fontWeight: "bold",
                }}
              >
                Introducing ourselves!
              </h2>
              <p style={{ textAlign: "center" }}>
                We are enthusiastic developers from Philippine speciallized in
                both frontend and backend.
              </p>
            </div>
            <div className="App">
              <div
                style={{
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <Card title="Card 1" image={image1} description="Card 1 설명" />

                <Card title="Card 2" image={image2} description="Card 2 설명" />
                <Card
                  title="Card 3"
                  image={image3}
                  descrip
                  tion="Card 3 설명"
                />
                {/* 필요한 만큼 Card 컴포넌트 추가 */}
              </div>
            </div>
            {/* 여러 작업을 추가하려면 위의 div를 복사하세요. */}
          </section>
        </div>
        {/* Back Button */}
        <button
          onClick={handleGoBack}
          style={{
            position: "fixed",
            top: "2vh",
            right: "2vw",
            cursor: "pointer",
            border: "0.4vh solid rgba(18, 0, 184, 1)",
            backgroundColor: "rgba(18, 0, 134, 1)",
            borderRadius: "1vh",
            color: "#ffffff",
            padding: "0.01vh 1vw",
            fontSize: "4.5vh",
            fontWeight: "bolder",
            transform: "scaleY(-1)",
            zIndex: 3,
          }}
        >
          ↩
        </button>
      </div>
    </div>
  );
}

export default AboutUs;
